import React from "react";
import { Route, Switch } from "react-router-dom";

export default class Dj extends React.Component {
  componentDidMount() {
    let listId = 1
    sessionStorage.setItem('webId', listId)
    sessionStorage.setItem('id', listId)
    
  }
  componentWillUnmount() {
    
  }
  getRoutes = routes => {
    return routes.map((prop, key) => {
      if (prop.layout != '/auth' ) {
        return (
          <Route
            path={prop.layout + prop.path}
            component={prop.component}
            key={key}
          />
        );
      } else {
        return null;
      }
    });
  };
  render() {
   var root= routes.map((prop, key) => {
      if (prop.layout != '/auth' ) {
        return (
          <Route
            path={prop.layout + prop.path}
            component={prop.component}
            key={key}
          />
        );
      } 
    });


    return (
      <>
      
        <div id="pageContainer" className="isMoved">
          <div id="shopify-section-vela-header" className="shopify-section">
            <Head />
            <AuthNavbar />
            <Menu />
            

               <Switch>{this.getRoutes(routes)}</Switch>
              
            <AuthFooter />
          </div>
        </div>
      </>
    );
  }
}
